import React from "react";

import "./Sidebar.css";

const Sidebar = () => {
  const existingNotes = [
    { header: "My Special Note 1", timestamp: "Last Updated: 1:37PM 7/26/19", body: "" },
    { header: "My Special Note 2", timestamp: "Last Updated: 1:37PM 7/26/20" },
  ];

  return (
    <aside class="sidebar">
      <button type="button" class="button block tertiary header-text">
        Create Note
      </button>
      <ul>
        <li class="active">
          <h3 class="header-text no-margin">{existingNotes[0].header}</h3>
          <p class="body-text no-margin muted">{existingNotes[0].timestamp}</p>
        </li>
        <li>
          <h3 class="header-text no-margin">{existingNotes[1].header}</h3>
          <p class="body-text no-margin muted">{existingNotes[1].timestamp}</p>
        </li>
      </ul>
    </aside>
  );
};

export default Sidebar;
